import React from "react";


const Header = () => {
  return (
    <header className="header">
      <img className="header__image" src="./images/header_img.png" alt="облако"/>
      <h1 className="title title_header">lead yourself</h1>
      <h2 className="subtitle subtitle_header">Визуальное агенство</h2>
    </header>
  );
};

export default Header;
